import React from 'react'

const Notification = ({ success_message, error_message }) => {
    if (success_message === null) {
        return null
    }
    if(error_message === null){
        return null
    }
    return (
        <div className="success">
            {success_message}
            {error_message}
        </div>
    )
}
export default Notification
